import React, { Component } from 'react';
import { connect } from 'react-redux';
import { push } from "connected-react-router";

import * as actions from "../../store/actions";

import './Login.scss';
import { FormattedMessage } from 'react-intl';
import { Form, Input } from 'reactstrap';

class Login extends Component {
    constructor(props) {
        super(props);
    }

    render() {


        return (
            <div className='login-background'>
                <div className='col'>
                    <div className='col-6 login-introduction'></div>
                    <div className='col-4 login-form'>
                        <div className='login-container'>
                            <div className='login-content'>
                                <div className=''>Aquatic System</div>
                                <div className=''>Welcome to Aquatic System</div>
                                <Form>
                                    <div className="form-group">
                                        <label>Email address:</label>
                                        <input type='text' className='form-control' placeholder='Enter your Username or Email'></input>
                                    </div>
                                    <div class="form-group">
                                        <label>Password:</label>
                                        <input type='password' className='form-control' placeholder='Enter your Password'></input>
                                    </div>
                                </Form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );

    };
};

const mapStateToProps = state => {
    return {
        lang: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
        navigate: (path) => dispatch(push(path)),
        adminLoginSuccess: (adminInfo) => dispatch(actions.adminLoginSuccess(adminInfo)),
        adminLoginFail: () => dispatch(actions.adminLoginFail()),
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(Login);
